import React from 'react';
import { PROJECTS, SKILLS, EXPERIENCE, ACHIEVEMENTS, NAV_LINKS } from '../../data';

const Overlay = ({ activeZone }) => {
  if (!activeZone) return (
    <div style={styles.instructions}>
      <h2>Use Arrow Keys or WASD to Move</h2>
      <p>Walk into colored zones to explore</p>
    </div>
  );

  let title = "";
  let content = null;

  switch (activeZone) {
    case 'projects':
      title = "Projects";
      content = (
        <div style={styles.grid}>
          {PROJECTS.map((p, i) => (
            <div key={i} style={styles.card}>
              <h3 style={{ color: p.color }}>{p.icon} {p.title}</h3>
              <p>{p.description}</p>
              <div style={styles.tags}>
                {p.tags.map(t => <span key={t} style={styles.tag}>{t}</span>)}
              </div>
            </div>
          ))}
        </div>
      );
      break;
    case 'skills':
      title = "Skills";
      content = (
        <div style={styles.list}>
          {SKILLS.map((s, i) => (
            <div key={i} style={{ ...styles.barContainer, borderColor: s.color }}>
              <div style={{ ...styles.bar, width: `${s.level}%`, backgroundColor: s.color }}>
                 <span style={styles.barText}>{s.name}</span>
              </div>
            </div>
          ))}
        </div>
      );
      break;
      case 'experience':
        title = "Experience";
        content = (
            <div style={styles.list}>
                {EXPERIENCE.map((e, i) => (
                    <div key={i} style={styles.card}>
                        <h3 style={{color: e.color}}>{e.role} @ {e.company}</h3>
                        <p style={{fontStyle: 'italic'}}>{e.period}</p>
                        <ul>
                            {e.points.map((pt, j) => <li key={j}>{pt}</li>)}
                        </ul>
                    </div>
                ))}
            </div>
        )
        break;
      case 'about':
        title = "About Me";
        content = (
            <div style={styles.card}>
                <p>Hi, I am Anshik Thakur. A passionate software developer with a knack for building immersive web experiences.</p>
                <h3>Achievements</h3>
                <ul>
                    {ACHIEVEMENTS.map((a, i) => (
                        <li key={i} style={{color: a.color}}><strong>{a.title}</strong> - {a.label}</li>
                    ))}
                </ul>
            </div>
        )
        break;
    default:
      return null;
  }

  return (
    <div style={styles.overlay}>
      <h1 style={styles.title}>{title}</h1>
      <div style={styles.content}>
        {content}
      </div>
    </div>
  );
};

const styles = {
  overlay: {
    position: 'absolute',
    top: '50px',
    right: '50px',
    bottom: '50px',
    width: '400px',
    backgroundColor: 'rgba(0, 0, 0, 0.85)',
    color: 'white',
    padding: '20px',
    borderRadius: '10px',
    overflowY: 'auto',
    border: '1px solid #444',
    backdropFilter: 'blur(5px)'
  },
  instructions: {
    position: 'absolute',
    bottom: '20px',
    left: '50%',
    transform: 'translateX(-50%)',
    color: 'white',
    textAlign: 'center',
    backgroundColor: 'rgba(0,0,0,0.5)',
    padding: '10px 20px',
    borderRadius: '20px'
  },
  title: {
    borderBottom: '2px solid #555',
    paddingBottom: '10px',
    marginBottom: '20px'
  },
  grid: {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px'
  },
  card: {
    backgroundColor: 'rgba(255,255,255,0.05)',
    padding: '15px',
    borderRadius: '8px'
  },
  tags: {
    display: 'flex',
    gap: '5px',
    flexWrap: 'wrap',
    marginTop: '10px'
  },
  tag: {
    fontSize: '12px',
    backgroundColor: '#333',
    padding: '2px 6px',
    borderRadius: '4px'
  },
  list: {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px'
  },
  barContainer: {
    border: '1px solid',
    borderRadius: '4px',
    height: '30px',
    position: 'relative',
    backgroundColor: 'rgba(0,0,0,0.3)'
  },
  bar: {
    height: '100%',
    display: 'flex',
    alignItems: 'center',
    paddingLeft: '10px',
    fontWeight: 'bold',
    color: '#000',
    borderRadius: '3px'
  },
  barText: {
    mixBlendMode: 'difference',
    color: 'white'
  }
};

export default Overlay;
